BEGIN TRANSACTION;
CREATE TABLE changed_bond(
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            cb_num_id int NOT NULL,
            bond_code text NOT NULL, 
            cb_name_id text NOT NULL,
            bond_date_id text NOT NULL,
            stock_code text NOT NULL,
            stock_name text NOT NULL,
            industry text NOT NULL,
            sub_industry text NOT NULL,
            cb_price2_id real NOT NULL,
            cb_mov2_id real NOT NULL,
            cb_mov3_id real NOT NULL,
            stock_price_id real NOT NULL,
            cb_mov_id real NOT NULL,
            cb_price3_id real NOT NULL,
            cb_strike_id real NOT NULL,
            cb_premium_id real NOT NULL,
            cb_value_id real NOT NULL,
            cb_t_id text NOT NULL,
            bond_t1 text NOT NULL,
            red_t text NOT NULL,
            remain_amount real NOT NULL,
            cb_trade_amount_id real NOT NULL,
            cb_trade_amount2_id real NOT NULL,
            cb_to_share real NOT NULL,
            cb_to_share_shares real NOT NULL,
            market_cap real NOT NULL,
            stock_pb real NOT NULL,
            BT_yield real NOT NULL,
            AT_yield real NOT NULL,
            BT_red real,
            AT_red real,
            npv_red real NOT NULL,
            npv_value real NOT NULL,
            rating text NOT NULL,
            discount_rate real NOT NULL,
            elasticity real NOT NULL,
            cb_ol_value real NOT NULL,
            cb_ol_rank int NOT NULL,
            cb_nl_value real NOT NULL,
            cb_nl_rank int NOT NULL,
            cb_ma20_deviate real NOT NULL,
            cb_hot int NOT NULL,
            duration real,
            enforce_get text,
            buy_back int,
            down_revise int,
            data_id INTEGER
            );
CREATE TABLE "changed_bond_extend" (
	"id"	INTEGER UNIQUE,
	"bond_num"	INTEGER,
	"bond_code"	INTEGER,
	"bond_name"	TEXT,
	"optional"	INTEGER,
	"interest"	TEXT,
	"ensure"	TEXT,
	"enforce_get_term"	TEXT,
	"buy_back_term"	TEXT,
	"down_revise_term"	TEXT,
	"theme"	TEXT,
	"style"	TEXT,
	"memo"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE "config" (
	"id"	INTEGER,
	"type"	TEXT,
	"key"	TEXT,
	"value"	TEXT,
	"modify_date"	TEXT,
	"field_name"	TEXT,
	"order_index"	INTEGER,
	"desc"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE "hold_bond" (
	"id"	INTEGER,
	"bond_code"	TEXT NOT NULL,
	"cb_name_id"	TEXT NOT NULL,
	"hold_price"	REAL DEFAULT 0.0,
	"hold_amount"	INTEGER DEFAULT 0,
	"hold_unit"	TEXT DEFAULT 1,
	"hold_owner"	TEXT DEFAULT 'me',
	"strategy_type"	TEXT,
	"account"	TEXT,
	"memo"	text,
	"suggest"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DELETE FROM "sqlite_sequence";
CREATE TABLE "stock_report" (
	"id"	INTEGER,
	"stock_code"	text NOT NULL,
	"stock_name"	text NOT NULL,
	"last_date"	text NOT NULL,
	"revenue"	real,
	"qoq_revenue_rate"	real,
	"yoy_revenue_rate"	real,
	"net"	real,
	"qoq_net_rate"	real,
	"yoy_net_rate"	real,
	"margin"	real,
	"qoq_margin_rate"	real,
	"yoy_margin_rate"	real,
	"roe"	real,
	"qoq_roe_rate"	real,
	"yoy_roe_rate"	real,
	"al_ratio"	real,
	"qoq_rl_ratio_rate"	real,
	"yoy_al_ratio_rate"	real,
	"pe"	REAL,
	"modify_date"	INTEGER,
	"net_asset"	REAL,
	"gross_rate"	REAL,
	"avg_market_cap"	REAL,
	"avg_net_asset"	REAL,
	"avg_net_margin"	REAL,
	"avg_pe"	REAL,
	"avg_pb"	REAL,
	"avg_gross_rate"	REAL,
	"avg_net_profit_ratio"	REAL,
	"avg_roe"	REAL,
	"rank_market_cap"	TEXT,
	"rank_net_asset"	TEXT,
	"rank_net_margin"	TEXT,
	"rank_pe"	TEXT,
	"rank_pb"	TEXT,
	"rank_gross_rate"	TEXT,
	"rank_net_profit_ratio"	TEXT,
	"rank_roe"	TEXT,
	"level_market_cap"	TEXT,
	"level_net_asset"	TEXT,
	"level_net_margin"	TEXT,
	"level_pe"	TEXT,
	"level_pb"	TEXT,
	"level_gross_rate"	TEXT,
	"level_net_profit_ratio"	TEXT,
	"level_roe"	TEXT,
	"stock_total"	REAL,
	"stock_level"	REAL,
	"trade_suggest"	TEXT,
	"fact_trend"	REAL,
	"fact_money"	REAL,
	"fact_news"	REAL,
	"fact_industry"	REAL,
	"fact_base"	REAL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE "user" (
	"id"	INTEGER,
	"name"	TEXT NOT NULL UNIQUE,
	"password"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
